import React from 'react';
import Navbar from './components/Navbar';
import './styles/App.css';
import Footer from './components/Footer';
import { Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path='/index' element={<Main />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
